import React from "react";
import Icon from "./Icon";
import "./SideBar.css";
import HomeIcon from "@mui/icons-material/Home";
import SearchIcon from "@mui/icons-material/Search";
import NotificationsNoneIcon from "@mui/icons-material/NotificationsNone";
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import PermIdentityIcon from '@mui/icons-material/PermIdentity';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import BookmarkBorderOutlinedIcon from '@mui/icons-material/BookmarkBorderOutlined';



function SideBar() {
  return (
    <div className="sideBar">
      <h1 className="logo">Sirius</h1>
      <Icon  iconText="Home" IconPic={HomeIcon} link="/"/>
      <Icon iconText="Explore" IconPic={SearchIcon} link="/explore" />
      <Icon iconText="Notificatons" IconPic={NotificationsNoneIcon} link="/notifications"/>
      <Icon iconText="Messages" IconPic={MailOutlineIcon} link="/messages"/>
      <Icon active iconText="Bookmarks" IconPic={BookmarkBorderOutlinedIcon} link="/bookmarks"/>
      <Icon iconText="profile" IconPic={PermIdentityIcon} link="/profile"/>
      <Icon iconText="Setting" IconPic={SettingsOutlinedIcon} link="/settings"/>
    </div>
  );
}

export default SideBar;
